import { fromJS } from 'immutable';

const defaultState = fromJS({
	topiclist: [{
		id: 1,
		title: 'news',
		imgUrl: 'images/news.png'
	}, {
		id: 2,
		title: 'books',
		imgUrl: 'images/book.jpg'
	}],
	articleList: [{
		id: 1,
		title: "BIRD'S PERFECT BAKED POTATOES",
		desc: "Preheat oven to 425 degrees Fahrenheit. Pierce potatoes a few times with a fork. Place oil in a small bowl. Place salt in another small bowl (if using). Place one potato at a time into oil bowl, and roll potato around in oil.",
		imgUrl: '/images/potato.jpg'
	}]
});

export default (state = defaultState, action) => {
	switch(action.type) {

		default :
			return state;
	}
}
